import { axiosPrivate } from "../../utils/FetchApi";
import { setCookie } from "../../utils/setCookie";
import { ACCESS_TOKEN_USER } from "../types";

export const getUsers = (accessToken) => {
  return async (dispatch) => {
    try {
      const req = await axiosPrivate.post("/checkusers", accessToken);
      dispatch({
        type: ACCESS_TOKEN_USER,
        payload: { users: req.data },
      });
      setCookie(req.data);
      return req;
    } catch (error) {
      console.log(error);
    }
  };
};
